  \"Red Rock Lakes National Wildlife Refuge : Managing for climate change, water resources
  and the future\",\n\t\"tracking_summary\": {\n\t\t\"total\": 0,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-10-25T19:03:49.498092\",\n\t\"name\": \"red-rock-lakes-national-wildlife-refuge-managing-for-climate-change-water-resources-and-th\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report is a summary of recommendations
  and actions to maintain and restore habitats on Red Rock Lakes National Wildlife
  Refuge (refuge) in the face of climate change.  The refuge provides important and
  diverse habitats for species of concern, endangered species, and provides breeding
  habitat for intermountain west migratory birds.  The diversity of refuge habitats,
  and the wildlife dependent upon them, is driven by the water resources that create
  the streams, shallow lakes, emergent wetlands, wet meadows, and fens found on the
  Refuge.  The direct and indirect losses of water resources due to a drier and warmer
  climate threatens the future of priority species like trumpeter swan and Arctic
  grayling, among other Northern Rockies LCC identified species found on the refuge.
  \ Habitat and water management recommendations with positive outcomes are discussed
  as future mitigation options for the refuge.\",\n\t\"license_title\": \"License
